import React from "react";

function About(){
    return(
        <div>
            <h1 id = "about_title">Who is this Liam?</h1>
            <div className="left_containter_about">
                <img src = "Headshot.jpg" alt = "Liam Mazure"></img>
            </div>
            <div className="right_container_about">
                <p></p>
            </div>
        </div>

    )
}

export default About;
